"use strict";Bridge.define("ClientTestLibrary.Linq.TestLinqRestrictionOperators",{statics:{test:function(n){var r,u,i,t,f,e;n.expect(5);r=[5,4,1,3,9,8,6,7,2,0];u=Bridge.Linq.Enumerable.from(r).where(function(n){return n<=6}).toArray();n.deepEqual(u,[5,4,1,3,6,2,0],"Where elements in integer array are below or equal 6");i=Bridge.Linq.Enumerable.from(ClientTestLibrary.Utilities.Person.getPersons()).where(function(n){return n.getCount()<501}).select(function(n){return n.getCount()}).toArray();n.deepEqual(i,[300,100,500,50],"Where elements in Person array have Count below 501");i=Bridge.Linq.Enumerable.from(ClientTestLibrary.Utilities.Person.getPersons()).where(function(n){return n.getCount()<501&&n.getGroup()==="A"}).select(function(n){return n.getCount()}).toArray();n.deepEqual(i,[300],"Where elements in Person array have Count below 501 ang in group 'A'");t=ClientTestLibrary.Utilities.Person.getPersons();f=Bridge.Linq.Enumerable.from(ClientTestLibrary.Utilities.Person.getPersons()).where(function(n){return n.getCount()<501}).toArray();n.deepEqual(f,[t.getItem(0),t.getItem(1),t.getItem(3),t.getItem(4)],"Where elements in Person array have Count below 501. Returns Person instances");e=Bridge.Linq.Enumerable.from(t).where(function(n,t){return n.getCount()<t*100}).toArray();n.deepEqual(e,[t.getItem(4)],"Where elements in Person array have Count meet condition (p.Count < index * 100). Returns Person instances")}}});Bridge.init();